const GifyModel= (props)=>{

    let [search,setSearch] = useState("");

    return(
        <div>
            <input />
            <ul>
                {
                  props.data.forEach((el)=>{
                  return(<li>{el.url}</li>)
                })
                }
            </ul>
        </div>
    )
}

export default GifyModel;
